import React from 'react'


class SearchBar extends React.Component {
    render() {
        return <div>
            <div>
                <input type="text" placeholder="Rechercher"/>
            </div>
            <div>
                <input type="checkbox" id="stock"/>
                <label htmlFor="stock"></label>
            </div>
        </div>
    } 
}

export default SearchBar;
